    public void ShouldPassKATsFromSphincsPlusReferenceImplementation(SlhdsaParameterSet slhdsaParameterSet, int testCaseNo, string threeNRandomBytesForKeyingMaterialString, string optRand, string msg, string expectedPk, string expectedSk, string expectedSm)
    {
        // grab all the values associated w/ the selected parameter set
        var slhdsaParameterSetAttributes = AttributesHelper.GetParameterSetAttribute(slhdsaParameterSet);
        _subject = new Slhdsa(slhdsaParameterSetAttributes, _shaFactory);
   
        // split the threeNRandomBytesForKeyingMaterialString into 3 n-byte strings
        var threeNRandomBytesForKeyingMaterial = new BitString(threeNRandomBytesForKeyingMaterialString).ToBytes();
        var nRandomBytesForSkSeed = threeNRandomBytesForKeyingMaterial[0..slhdsaParameterSetAttributes.N];
        var nRandomBytesForSkPrf = threeNRandomBytesForKeyingMaterial[slhdsaParameterSetAttributes.N..(2*slhdsaParameterSetAttributes.N)];
        var nRandomBytesForPkSeed = threeNRandomBytesForKeyingMaterial[(2*slhdsaParameterSetAttributes.N)..(3*slhdsaParameterSetAttributes.N)];
        
        // create the key pair
        var keyPair = _subject.SlhKeyGen(nRandomBytesForSkSeed, nRandomBytesForSkPrf, nRandomBytesForPkSeed);
        
        var msgBytes = new BitString(msg).ToBytes();
        
        var optRandBytes = new BitString(optRand).ToBytes();
        
        // calculate the slhdsa signature of message
        //var sig = _subject.SlhSignWithoutRandomization(msgBytes, keyPair.PrivateKey, slhdsaParameterSetAttributes);
        var sig = _subject.Sign(keyPair.PrivateKey.GetBytes(), msgBytes, optRandBytes);
        
        // sm is the message signature with the message appended
        var smLen = sig.Length + msgBytes.Length;
        byte[] smBytes = new byte[smLen];
        sig.CopyTo(smBytes, 0);
        msgBytes.CopyTo(smBytes, sig.Length);
        
        // was the key generated correctly?
        byte[] pkBytes = new byte[2*slhdsaParameterSetAttributes.N]; 
        keyPair.PublicKey.PkSeed.CopyTo(pkBytes, 0);
        keyPair.PublicKey.PkRoot.CopyTo(pkBytes, slhdsaParameterSetAttributes.N);
        
        byte[] skBytes = new byte[4*slhdsaParameterSetAttributes.N];
        keyPair.PrivateKey.SkSeed.CopyTo(skBytes, 0);
        keyPair.PrivateKey.SkPrf.CopyTo(skBytes, slhdsaParameterSetAttributes.N);
        keyPair.PrivateKey.PkSeed.CopyTo(skBytes, 2*slhdsaParameterSetAttributes.N);
        keyPair.PrivateKey.PkRoot.CopyTo(skBytes, 3*slhdsaParameterSetAttributes.N);
        // Console.WriteLine($"pkBytes(expected): {new BitString(expectedPk).ToHex()}");
        // Console.WriteLine($"pkBytes(computed): {new BitString(pkBytes).ToHex()}");
        // Console.WriteLine($"skBytes: {new BitString(skBytes).ToHex()}");
        Assert.That(new BitString(pkBytes).ToHex(), Is.EqualTo(new BitString(expectedPk).ToHex()));
        Assert.That(new BitString(skBytes).ToHex(), Is.EqualTo(new BitString(expectedSk).ToHex()));
        
        // verify the signature using our implementation of SlhVerify()
        var result = _subject.Verify(keyPair.PublicKey.GetBytes(), msgBytes, sig);
        Assert.That(result, Is.True);
        
        // check if the computed signature matches the expected signature
        Assert.That(new BitString(smBytes).ToHex(), Is.EqualTo(new BitString(expectedSm).ToHex()));
    }
